// src/App.js
import React from "react";
import { useGetSampleDataQuery } from "./services/sampleApi";

function App() {
  const { data, error, isLoading } = useGetSampleDataQuery();

  return (
    <div className="App">
      <header className="bg-blue-500 text-white p-4">
        <h1 className="text-3xl font-bold">
          Welcome to React with Tailwind CSS and RTK Query
        </h1>
      </header>
      <main className="p-4">
        {isLoading && <p className="text-gray-700">Loading...</p>}
        {error && <p className="text-red-500">Error: {error.message}</p>}
        {!isLoading && !error && (
          <ul className="text-gray-700">
            {data.map((item) => (
              <li key={item.id}>{item.title}</li>
            ))}
          </ul>
        )}
      </main>
    </div>
  );
}

export default App;
